Atomic Data requires a bit more information about pieces of data than JSON tends to contain. Let's take a look at a regular JSON example: { "name": "John", "birthDate": "1991-01-20"
} We need more information to convert this JSON into Atomic Data. The following things are missing: What is the Subject URL of the resource being described? What is the Property URL of the keys being used? (name and birthDate), and consequentially, how should the values be parsed? What are their DataTypes? In order to make this conversion work, we need to link to three URLs that resolve to atomic data resources . The @id subject should resolve to the Resource itself, returning the JSON-AD from below. The Property keys (e.g. "https://example.com/properties/name") need to resolve to Atomic Properties. { "@id": "https://example.com/people/john", "https://example.com/properties/name": "John", "https://example.com/properties/birthDate": "1991-01-20"
} In practice, the easiest approach to make this conversion, is to create the data and host it using software like Atomic Server .

