Atomic Data is a strict subset of RDF, and the most popular serialization of RDF for JSON data is JSON-LD . Since Atomic Schema requires the presence of a key slug in Properties, converting Atomic Data to JSON results in dev-friendly objects with nice shorthands. { "@id": "https://example.com/people/John", "https://example.com/properties/lastname": "John", "https://example.com/properties/bestFriend": "https://example.com/sarah",
} Can be automatically converted to: { "@context": { "@id": "https://example.com/people/John", "name": "https://example.com/properties/lastname", "bestFriend": "https://example.com/properties/bestFriend", }, "name": "John", "bestFriend": { "@id": "https://example.com/sarah" },
} The @context object provides a mapping to the original URLs. JSON-AD and JSON-LD are very similar by design, but there are some important differences: JSON-AD is designed just for atomic data, and is therefore easier and more performant to parse / serialize. JSON-LD uses @context to map keys to URLs. Any type of mapping is valid. JSON-AD, on the other hand, doesn't map anything - all keys are URLs. JSON-LD uses nested objects for links and sequences, such as @list. JSON-AD does not. Arrays in JSON-LD do not indicate ordered data - they indicate that for some subject-predicate combination, multiple values exist. This is a result of how RDF works.

