Every Resource is composed of Atoms . The Atom is the smallest possible piece of meaningful data / information (hence the name). You can think of an Atom as a single cell in a spreadsheet or database. An Atom consists of three fields: Subject : the Thing that the atom is providing information about. Property : the property of the Thing that the atom is about (will always be a URL to a Property ). Value : the new piece of information about the Atom. If you're familiar with RDF, you'll notice similarities. An Atom is comparable with an RDF Triple / Statement ( although there are important differences ). Let's turn this sentence into Atoms: Arnold Peters, who's born on the 20th of Januari 1991, has a best friend named Britta Smalls. Subject Property Value Arnold last name Peters Arnold birthdate 1991-01-20 Arnold best friend Britta Britta last name Smalls The table above shows human readable strings, but in Atomic Data, we use links (URLs) wherever we can. That's because links are awesome. Links remove ambiguity (we know exactly which person or property we mean), they are resolvable (we can click on them), and they are machine readable (machines can fetch links to do useful things with them). So the table from above, will more closely resemble this one: Subject Property Value https://example.com/arnold https://example.com/properties/lastname Peters https://example.com/arnold https://example.com/properties/birthDate 1991-01-20 https://example.com/arnold https://example.com/properties/bestFriend https://example.com/britta https://example.com/britta https://example.com/properties/lastname Smalls The standard serialization format for Atomic Data is JSON-AD, which looks like this: [{ "@id": "https://example.com/arnold", "https://example.com/properties/lastname": "Peters", "https://example.com/properties/birthDate": "1991-01-20", "https://example.com/properties/bestFriend": "https://example.com/britta",
},{ "@id": "https://example.com/britta", "https://example.com/properties/lastname": "Smalls",
}] The @id field denotes the Subject of each Resource, which is also the URL that should point to where the resource can be found. In the JSON-AD example above, we have: two Resources , describing two different Subjects : https://example.com/arnold and https://example.com/britta. three different Properties (https://example.com/properties/bornAt, https://example.com/properties/firstName, and https://example.com/properties/bestFriend) four Values (1991-01-20, Arnold, https://example.com/britta and Britta) four Atoms - every row is one Atom. All Subjects and Properties are Atomic URLs: they are links that point to more Atomic Data. One of the Values is a URL, too, but we also have values like Arnold and 1991-01-20. Values can have different Datatypes In most other data formats, the datatypes are limited and are visually distinct. JSON, for example, has array, object, string, number and boolean. In Atomic Data, however, datatypes are defined somewhere else, and are extendible. To find the Datatype of an Atom, you fetch the Property, and that Property will have a Datatype. For example, the https://example.com/properties/bornAt Property requires an ISO Date string, and the https://example.com/properties/firstName Property requires a regular string. This might seem a little tedious and weird at first, but is has some nice advantages! Their Datatypes are defined in the Properties.

