} Then the following Path targets the McLovin value: https://example.com/john https://example.com/lastName => McLovin Instead of using the full URL of the lastName Property, we can use its shortname : https://example.com/john lastname => McLovin We can also traverse relationships between resources: [{ "@id": "https://example.com/john", "https://example.com/lastName": "McLovin", "https://example.com/employer": "https://example.com/XCorp",
},{ "@id": "https://example.com/XCorp", "https://example.com/description": "The greatest company!",
}] https://example.com/john employer description => The greatest company! In the example above, the XCorp subject exists and is the source of the The greatest company! value. We can use this path as a unique identifier for the description of John's current employer. Note that the data for the description of that employer does not have to be in John's control for this path to work - it can live on a totally different server. However, in Atomic Data it's also possible to include this description in the resource of John as a Nested Resource .

